import React, { useState } from "react";
import "./Test.css"; // Add custom CSS for styling

function Test() {
  const [formData, setFormData] = useState({
    username: "",
    email: "",
    password: "",
    confirmPassword: "",
  });

  const [error, setError] = useState("");

  const handleChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    if (formData.password !== formData.confirmPassword) {
      setError("Passwords do not match!");
    } else {
      setError("");
      alert("Form submitted!");
    }
  };

  return (
    <div className="signup-container">
      {/* Left Section with Design */}
      <div className="left-section">
        <div className="triangle-placeholder">
          {/* Insert Image Here */}
        </div>
        <div className="circle-design"></div>
      </div>

      {/* Right Section with Form */}
      <div className="right-section">
        <form className="signup-form" onSubmit={handleSubmit}>
          <h2>Sign Up</h2>
          <input
            type="text"
            name="username"
            placeholder="Enter a username"
            value={formData.username}
            onChange={handleChange}
          />
          <input
            type="email"
            name="email"
            placeholder="Enter your email"
            value={formData.email}
            onChange={handleChange}
          />
          <input
            type="password"
            name="password"
            placeholder="Enter your password"
            value={formData.password}
            onChange={handleChange}
          />
          <input
            type="password"
            name="confirmPassword"
            placeholder="Confirm Password"
            value={formData.confirmPassword}
            onChange={handleChange}
          />
          {error && <p className="error-message">{error}</p>}
          <button type="submit" className="signup-button">Sign Up</button>
          <p className="or">OR</p>
          <button type="button" className="image-signup">
            {/* Placeholder for the Image */}
            <div className="image-placeholder">Insert Image Here</div>
            Sign Up with Image
          </button>
          <p className="login-redirect">
            Already have an account? <a href="/login">Login</a>
          </p>
        </form>
      </div>
    </div>
  );
}


export default Test;
